}
.source.java .meta.method.return-type .parameter,
.source.java .meta.method.identifier .parameter {
  color: #d9dec3;
}
.source.java .storage.modifier {
  color: #e6c37e;
}
.source.java .storage.modifier.package,
.source.java .storage.modifier.import {
  color: #d9dec3;
}
.source.java .storage.type {
  color: #7ea158;
}
.source.java .storage.type.annotation {
  color: #9c8db1;
}
.source.java .storage.type.generic {
  color: #a8b577;
}
.source.java .keyword.other.import,
.source.java .keyword.other.package {
  color: #9c8db1;
}
.source.js .meta.import .keyword.control,
.source.js .meta.export .keyword.control {
  color: #e6c37e;
}
.source.js .meta.method-call .entity.name.function {
  color: #d9dec3;
}
.source.js .variable.default {
  color: #e6c37e;
}
.source.js .storage {
  color: #c77fa4;
}
.source.js .string.template .embedded,
.source.js .string.template .embedded.punctuation,
.source.js .string.template .embedded .constant,
.source.js .string.template .embedded .variable,
.source.js .string.template .embedded .keyword.operator {
  color: #7ea158;
}
.source.json .meta.structure.dictionary .string {
  color: #e6c37e;
}
.source.json .meta.structure.dictionary .punctuation.definition {
  color: #cea149;
}
.source.json .meta.structure.dictionary .punctuation.definition.dictionary,
.source.json .meta.structure.dictionary .punctuation.definition.array {
  color: #d9dec3;
}
.source.json .meta.structure.dictionary .dictionary.value .string {
  color: #81c7be;
}
.source.json .meta.structure.dictionary .dictionary.value .string .punctuation.definition {
  color: #469c91;
}
.source.json .meta.structure.dictionary .dictionary.value .dictionary .string {
  color: #e6c37e;
}
.source.json .meta.structure.dictionary .dictionary.value .dictionary .string .punctuation.definition {
  color: #cea149;
}
.source.json .meta.structure.dictionary .dictionary.value .dictionary .dictionary.value .string {
  color: #81c7be;
}
.source.ruby .string.double.quoted .embedded {
  color: #7ea158;
}
.source.ruby .punctuation.separator.variable,
.source.ruby .variable.block {
  color: #e6c37e;
}
.source.ruby .variable.instance {
  color: #9c8db1;
}
.source.ruby .variable.instance .punctuation.definition {
  color: #75628f;
}
.source.ruby .punctuation.inheritance {
  color: #e6c37e;
}
.source.ruby .constant.symbol {
  color: #a8b577;
}
.source.ruby .constant.symbol .punctuation.definition {
  color: #7ea158;
}
.source.ruby .keyword.other.special-method {
  color: #e6c37e;
}
/*
  ┌──────────┐
  │ eclectic │
  └──────────┘
*/
