}
.string {
  color: #a8b577;
}
.entity.name.function {
  color: #81c7be;
}
.constant {
  color: #d9dec3;
}
.constant.numeric {
  color: #e6c37e;
}
.constant.null {
  color: #e6c37e;
}
.constant.character.escape {
